function App() {
  function test() {
  return (
    <div className="test">
      <h1>test</h1>
      <p>hello world</p>
    </div>
  );
}
  return (
    <div className="App">
      <h1>country select</h1>
      <header className="App-header">
        <button onClick={test()}>test</button>
        <SearchBar/>
      </header>
    </div>
  );
}
export default App;
